import React, { Component } from 'react';
import { PayrollEmployeeList } from './PayrollEmployeeList';
import axios from 'axios';

export class Layout extends Component {
  static displayName = Layout.name;

  UNSAFE_componentWillMount() {
    this.LoadData();
  }
  
  LoadData () {
    let config = {
      headers: {
        'Access-Control-Allow-Origin' : '*',
        'contentType': 'application/json',
      }
    }

    axios
    .get("http://localhost:52688/Payroll/Employee/Get", config)
    .then(data => 
      { 
        this.employeeList = data.data.map((employee) =>
          <li key={employee}>{employee.Lastname}</li>
        );
      })
    .catch(error => console.log(error));
  }

  render () {
    return (
      <div className="Maindiv">
        <PayrollEmployeeList>{this.employeeList}</PayrollEmployeeList>
      </div>
    );
  }
}
